import { ERR_NOTIFI_SIGNUP } from "../constants/signup.constant"

const initialState = {
    message: ""
}

export const SignUpReducer = (state = initialState, { type, payload }) => {
    switch (type) {
        case ERR_NOTIFI_SIGNUP:
            state.message = payload
            return { ...state, ...payload }
        default:
            return state
    }
}
